import banner_img from './assets/homedisplay.png';

const banner = () => {
    return(
        <div className='row'>
            <img className="homedisplay" src={banner_img} alt='titikman-banner'/>
            <p>hahhaha</p>
        </div>
    );

}

const Home = () => {

    return(
        <div className='Home'>
            <h1>test</h1>
            <banner />
        </div>
    );
    
}

export default Home;
